class NumArray {
public:
    explicit NumArray(std::vector<int>& nums) {
        numsArray = nums;
        int chunkSizeSqrt = ceil(std::sqrt(nums.size()));
        chunkSize = std::max(chunkSizeSqrt, minChunkSize);
        initChunks();
    }

    void initChunks() {
        int chunksTotal = ceil(static_cast<double>(numsArray.size()) / chunkSize);
        chunkToSum = std::vector(chunksTotal, 0);
        for (int currentChunk = 0; currentChunk < chunksTotal; ++currentChunk) {
            int begin_i = currentChunk * chunkSize;
            int end_i = std::min(begin_i + chunkSize - 1, static_cast<int>(numsArray.size()) - 1);
            int chunkSum = 0;
            for (int i = begin_i; i <= end_i; ++i)
                chunkSum += numsArray[i];
            chunkToSum[currentChunk] = chunkSum;
        }
    }

    void update(int index, int val) {
        int oldVal = numsArray[index];
        if (val == oldVal)
            return;
        int chunkNum = index / chunkSize;
        int chunksSum = chunkToSum[chunkNum] - oldVal + val;
        chunkToSum[chunkNum] = chunksSum;
        numsArray[index] = val;
    }

    int sumRange(int left, int right) {
        int leftChunk = left / chunkSize;
        int rightChunk = right / chunkSize;

        int chunksSum = 0;
        for (int chunkNum = leftChunk; chunkNum <= rightChunk; ++chunkNum)
            chunksSum += chunkToSum[chunkNum];

        // remove left redundant nums
        int left_chunk_begin_i = leftChunk * chunkSize;
        for (int i = left_chunk_begin_i; i < left; ++i)
            chunksSum -= numsArray[i];

        // remove right redundant nums
        int right_chunk_end_i = std::min(rightChunk * chunkSize + chunkSize - 1, static_cast<int>(numsArray.size()) - 1);
        for (int i = right + 1; i <= right_chunk_end_i; ++i)
            chunksSum -= numsArray[i];

        return chunksSum;
    }

private:
    std::vector<int> numsArray;
    int chunkSize;
    const int minChunkSize = 3;
    std::vector<int> chunkToSum;
};

